import React from 'react';
import { View } from 'react-native';
import * as ExpoPrint from 'expo-print';

const Print: React.FC = () => {
    return <View style={{ flex: 1 }}>
        ExpoPrint.selectPrinterAsync()
    </View>;
};

export default Print;
